import React from 'react';
import { Button } from "@material-ui/core";
import './Login.css';
import { auth,provider } from './firebase';

function Login() {
    const signIn = () => {
        auth.signIn
    };
    return (
        <div className='login'>
            <div className="login__container">
                <img src='https://i0.wp.com/metro.co.uk/wp-content/uploads/2019/12/WhatsApp-from-Facebook-d14e.jpg?quality=90&strip=all&zoom=1&resize=480%2C268&ssl=1' alt='' 
                />
                <div className='login__text'>
                    <h>Sign In to WhatsApp</h>
                </div>
                <Button onClick={signIn} >
                    Sign in with Google
                </Button>
            </div>
        </div>
    )
}

export default Login
